import {
    Form,
    FormGroup,
    Label,
    Input,
    Button,
    Container,
  } from "reactstrap";

  const onSubmit=(event)=>{
    event.preventDefalut()
    console.log(event.target.elements);
  }

  function Login() {
    return (
      <Container className="my-3 ">
        <h2 className="text-center">Login Form</h2>
      <Form onSubmit={onSubmit} inline>
      <FormGroup className="text-center mb-2 me-sm-2 mb-sm-0">
      <Label
        className="me-sm-2 text-center"
        for="exampleEmail"
      >
        Email
      </Label>
      <Input
        id="exampleEmail"
        name="email"
        style={{width:"50%",
        display:"block",
        margin:"0 auto",
      }}
        placeholder="enter your email address"
        type="email"
      />
    </FormGroup>
    <FormGroup className="text-center mb-2 me-sm-2 mb-sm-0">
      <Label
        className="me-sm-2 "
        for="examplePassword"
      >
        Password
      </Label>
      <Input
        id="examplePassword"
        name="password"
        style={{width:"50%",
        display:"block",
        margin:"0 auto",
      }}
        placeholder="enter password"
        type="password"
      />
    </FormGroup>
    <Container className="text-center my-3">
    <Button   className="mx-2" color="primary" outline type="Submit">
      Submit
    </Button>

    <Button  color="danger" type="reset" outline>
      clear
    </Button>
    </Container>
  </Form>
      </Container>
    );
  }

  export default Login;
